import CreateAccountForm from './CreateAccountForm'
import Button from 'react-bootstrap/Button'

const Pupup = (props: {closePopup: ()=>void}) =>{


  return(
    <div className='popupContainer'>
    <div className='popUp'>
    <CreateAccountForm/>
    <Button onClick={props.closePopup}className='cancelPopup' variant='danger'>Cancel</Button>
    </div>
    </div>
  )
}

export default Pupup
